import React, { useState } from 'react';
import { Dialog } from '@headlessui/react';
import gear from '../assets/visual.png';
import Logo from '../assets/Logo.png';


const Header = () => {
  const [mobileMenuOpen, setMobileMenuOpen] = useState(false);

  const navItems = [
    { label: 'About', href: '#about' },
    { label: 'Features', href: '#features' },
    { label: 'Customers', href: '#customers' },
    { label: 'Updates', href: '#updates' },
    { label: 'Help', href: '#help' }
  ];

  return (
    <div className="min-h-screen">
      {/* Header */}
      <header className="absolute w-full top-0 z-50" style={{padding:0, backgroundColor:''}}>
        <nav className="flex items-center justify-between px-4 py-4 lg:px-8" style={{height:'87px'}}>
          <div className="flex items-center">
            <div className="text-2xl font-bold flex items-center">
            <img src={Logo} alt="Logo" className="h-8 w-auto mr-2" />
            </div>
          </div>

          {/* Desktop Navigation */}
          <div className="hidden md:flex items-center space-x-8" style={{fontWeight:'400',lineHeight:'23px',color:'background: rgba(0, 0, 0, 0.6)'}}>
            {navItems.map((item) => (
              <a 
                key={item.label} 
                href={item.href}
                className="text-gray-600 hover:text-gray-900"
              >
                {item.label}
              </a>
            ))}
            <button className="bg-black text-white px-4 py-2 rounded-lg">
              Get for free
            </button>
          </div>

          {/* Mobile Menu Button */}
          <button 
            className="md:hidden"
            onClick={() => setMobileMenuOpen(true)}
          >
            <svg className="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 6h16M4 12h16m-7 6h7" />
            </svg>
          </button>
        </nav>

        {/* Mobile Menu */}
        <Dialog 
          open={mobileMenuOpen} 
          onClose={() => setMobileMenuOpen(false)}
          className="relative z-50 md:hidden"
        >
          <div className="fixed inset-0 bg-black/20" aria-hidden="true" />
          <div className="fixed inset-y-0 right-0 w-full bg-white p-6 sm:max-w-sm">
            <div className="flex justify-between items-center">
              <div className="text-2xl font-bold">joyful</div>
              <button onClick={() => setMobileMenuOpen(false)}>
                <svg className="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M6 18L18 6M6 6l12 12" />
                </svg>
              </button>
            </div>
            <div className="mt-6">
              {navItems.map((item) => (
                <a
                  key={item.label}
                  href={item.href}
                  className="block py-3 text-gray-600 hover:text-gray-900"
                >
                  {item.label}
                </a>
              ))}
            </div>
          </div>
        </Dialog>
      </header>

      {/* Hero Section */}
      <main className="relative pt-16">
        <div className="min-h-screen bg-gradient-to-b from-blue-50 via-blue-100 to-blue-600">
          <div className="container mx-auto px-4 py-12 md:py-24">
            <div className="flex flex-col md:flex-row items-center">
              {/* Content */}
              <div className="w-full md:w-1/2 text-left">
                <p className="text-sm mb-4">Version 2.0 is here</p>
                <h1 className="text-5xl md:text-6xl font-bold mb-6">
                  Pathway to productivity
                </h1>
                <p className="text-lg md:text-xl mb-8 text-gray-700 max-w-xl">
                  Celebrate the joy of accomplishment with an app designed to track your progress, motivate your efforts, and celebrate your successes.
                </p>
                <div className="flex space-x-4">
                  <button className="bg-black text-white px-6 py-3 rounded-lg">
                    Get for free
                  </button>

                </div>
              </div>

              {/* Image */}
              <div className="w-full md:w-1/2 mt-12 md:mt-0">
                <div className="relative">
                  <img 
                    src={gear}
                    className="w-full h-auto"
                  />
                </div>
              </div>
            </div>

            {/* Partner Logos */}
            <div className="mt-16 grid grid-cols-3 md:grid-cols-6 gap-8 items-center opacity-50">
              {['Arrow Corp', 'Quantum', 'Echo Valley', 'Celestial', 'PULSE', 'APEX'].map((partner) => (
                <img
                  key={partner}
                  src="/api/placeholder/120/40"
                  alt={partner}
                  className="h-8 w-auto mx-auto"
                />
              ))}
            </div>
          </div>
        </div>
      </main>
    </div>
  );
};

export default Header;
